import React from 'react'
import "./logout.css"
import { useNavigate } from 'react-router-dom'

const Logout = () => {
    const navigate = useNavigate();
    const handleClick = async () => {
        localStorage.clear();
        navigate("/login");
    }
    return (
        <div>Logout</div>
    )
}

export default Logout
